import React, { Component } from 'react';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {};
    this.fetchToday();
    this.fetchAvailability();
  }

  async fetchToday() {
    try {
      const res = await fetch("http://localhost:4433/today");
      const json = await res.json();
      this.setState({today: json.today});
    } catch (e) {
      console.error("Failed to fetch 'today' data", e);
    }
  }

  async fetchAvailability() {
    try {
      const res = await fetch("http://localhost:4433/availability");
      const json = await res.json();
      this.setState({availability: json.availability});
    } catch (e) {
      console.error("Failed to fetch availability data", e);
    }
  }

  async fetchReservedTimes() {
    try {
      const res = await fetch("http://localhost:4433/reserved");
      const json = await res.json();
      this.setState({reserved: json.reserved});
    } catch (e) {
      console.error("Failed to fetch availability data", e);
    }
  }

  handleClick = (advisor_id, chosen_time) => {
    console.log("button clicked");
    if (this.state.name) {
      const data = {
        "student_name": this.state.name,
        "advisor_id": advisor_id,
        "chosen_time": chosen_time
      }
      fetch("http://localhost:4433/selected",
        {
          headers: {
            'Content-Type': 'application/json'
          },
          method: 'POST',
          body: JSON.stringify(data)
        }
      );
    } else {
      console.log("no name", this.state.name);
    }
  }

  render() {

    return (
      <div className="App container">
        <h1>Book Time with an Advisor</h1>
        <p>Name {this.state.name}</p>
        {this.state.today && <span id="today">Today is {this.state.today}.</span>}

        <form id="name-form" className="col-md-6">
          <div className="form-group">
            <label htmlFor="name-field">Your Name</label>
            <input type="text" id="name-field" className="form-control"
              onChange={ev => this.setState({name: ev.target.value})}/>
          </div>
        </form>


        <h2>Available Times</h2>
        <table className="advisors table">
          <thead>
            <tr>
              <th>Advisor ID</th>
              <th>Available Times</th>
            </tr>
          </thead>
          {this.state.availability &&
            <tbody>
            {this.state.availability.map((advisor, key) => {
              return (
                <tr key={advisor.id}>
                  <td>{advisor.id}</td>
                  <td>
                    <ul className="list-unstyled">
                      {advisor.opentimes.map((opentime, index) => {
                        return <li>
                                <time dateTime={opentime} className="book-time">{opentime}</time>
                                <button className="book btn-small btn-primary" onClick={this.handleClick.bind(this, advisor.id, opentime)}>Book</button>
                              </li>
                      })}
                    </ul>
                  </td>
                </tr>
              )
              })
            }
            </tbody>
          }
        </table>


        <h2>Booked Times</h2>
        <table className="bookings table">
          <thead>
            <tr>
              <th>Advisor ID</th>
              <th>Student Name</th>
              <th>Date/Time</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>36232</td>
              <td>John Smith</td>
              <td>
                <time dateTime="2019-04-03T10:00:00-04:00">4/3/2019 10:00 am</time>
              </td>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default App;
